        <div className='linhaTexto-fornecedor'>
          <h1 className='h1-fornecedor'>Novo fornecedor</h1>
        </div>

        <div className='linha1-fornecedor'>
          <div className='div-text-fornecedor'>Cnpj:</div>
        </div>
      </div>
    )
  }
}

export default NovoFornecedor
